import unittest

from M3_LongestSubstrWoRepeat import Solution


class TestRSWR(unittest.TestCase):

    def test_basic(self):
        """
        basic test
        """
        s = 'abc'
        result = Solution().lengthOfLongestSubstring2(s)
        self.assertEqual(result, 3)

    def test_cont(self):
        """
        testing str with all-the-same char
        """
        s = 'aaa'
        result = Solution().lengthOfLongestSubstring2(s)
        self.assertEqual(result, 1)

    def test_emp(self):
        """
        testing empty str
        """
        s = ''
        result = Solution().lengthOfLongestSubstring2(s)
        self.assertEqual(result, 0)

